  VALUES
  ('2021-06-10', '2021-06-10', 'a@b.ru', 'Иван', 'Васильевич', '«Недавно я прочитал роман М. Булгакова «Мастер и Маргарита». Он был написан в 1940 году. Этот роман просто потряс моё воображение! В нем рассказывается о нескольких событиях и судьбах – судьба Мастера и Маргариты, Понтия Пилата и Иешуа, прибытие Воланда и его свиты в Москву, события в Грибоедове и другое. Роман читается на одном дыхании, события захватывают в самом начале и не отпускают до конца. Интрига сохраняется на протяжении всего прочтения – это огромный плюс повествования, это интересно.', '87654321', 0, 'test1'),
